import Video from "../../videos/MVI_0358.mp4";
import { ActionContainer, ActionBg, VideoBg } from "./ActionElements";

export const ActionSection = () => {
  return (
    <ActionContainer>
      <ActionBg>
        <VideoBg autoPlay loop muted src={Video} type="video/mp4" />
      </ActionBg>
      <ActionContent>
        <ActionH1></ActionH1>
      </ActionContent>
    </ActionContainer>
  );
};
